import React, { useState } from "react";

const App = () => { 
    let onChange = (e)=>{
        console.log(e.target.value);
    }

    return (
        <>
            <h2>Hello Akalesh</h2>
            <div id="form">
                <input type='text' onChange={onChange}></input>
                <button >Click Me</button>
            </div>
        </>
    );
};

export default App;
